window.bookSummaryJSON = "<p><b>Devastated. Abandoned. Denied.</b></p> <p>With Sienna separated from her Soul Bonded alphas, her time is running out. Her body is failing, and she can't survive without them. And after the events of the Bonding Trials, she's on the verge of giving up.</p> <p>She put her trust in her pack again and again, and they failed every single time. Her heart can't take any more lies.</p> <p>The Cohen pack is determined to find Sienna and bring her home. And nothing is off the table.</p> <p><i>This is book two in the Bonding Trials duology. Make sure to listen to book one,</i> Denied, <i> first.</i></p>"; 
